/*Data for the table `diseases` */

insert  into `diseases`(`id`,`disease_name`,`description`,`created_at`,`updated_at`,`isDeleted`) values (12,'Abscess','A cutaneous abscess is a localized collection of pus in the skin and may occur on any skin surface. Symptoms and signs are pain and a tender and firm or fluctuant swelling. Diagnosis is usually obvious by examination. Treatment is incision and drainage.','2018-01-30 18:51:35','2018-01-30 18:51:35',0),(14,'Anemia','Anemia is a condition that develops when your blood lacks enough healthy red blood cells or hemoglobin. Hemoglobin is a main part of red blood cells and binds oxygen. If you have too few or abnormal red blood cells, or your hemoglobin is abnormal or low, the cells in your body will not get enough oxygen.','2018-01-30 19:06:34','2018-01-30 19:06:34',0),(15,'ARI (cough and colds)','The common cold, also known simply as a cold, is a viral infectious disease of the upper respiratory tract that primarily affects the nose. These may include coughing, sore throat, runny nose, sneezing, headache, and fever.','2018-01-30 19:06:49','2018-01-30 19:06:49',0),(16,'Arthritis','Arthritis is inflammation of one or more of your joints. The main symptoms of arthritis are joint pain and stiffness, which typically worsen with age. Osteoarthritis causes cartilage â€” the hard, slippery tissue that covers the ends of bones where they form a joint to break down.','2018-01-30 19:06:56','2018-01-30 19:06:56',0),(17,'Asthma','Asthma (AZ-ma) is a chronic (long-term) lung disease that inflames and narrows the airways. Asthma causes recurring periods of wheezing (a whistling sound when you breathe), chest tightness, shortness of breath, and coughing. The coughing often occurs at night or early in the morning.','2018-01-30 19:07:33','2018-01-30 19:07:33',0),(18,'ATP (sore throat)','A sore throat is pain, scratchiness or irritation of the throat that often worsens when you swallow. The most common cause of a sore throat (pharyngitis) is a viral infection, such as a cold or the flu. A sore throat caused by a virus resolves on its own','2018-01-30 19:07:41','2018-01-30 19:07:41',0),(19,'Bites','Stings and bites from insects are common. They often result in redness and swelling in the injured area. Sometimes a sting or bite can cause a life-threatening allergic reaction or transmit pathogens (viruses, bacteria or parasites, for example) to humans.','2018-01-30 19:08:00','2018-01-30 19:08:00',0),(20,'Burn','Treatments for a first-degree burn include: soaking the wound in cool water for five minutes or longer. taking acetaminophen or ibuprofen for pain relief. applying lidocaine (an anesthetic) with aloe vera gel or cream to soothe the skin.','2018-01-30 19:08:07','2018-01-30 19:08:07',0),(21,'CANCER','Cancer is the name given to a collection of related diseases. ... Many cancers form solid tumors, which are masses of tissue. Cancers of the blood, such as leukemias, generally do not form solid tumors. Cancerous tumors are malignant, which means they can spread into, or invade, nearby tissues.','2018-01-30 19:08:24','2018-01-30 19:08:24',0),(22,'Chicken Pox','Chickenpox is a very contagious disease caused by the varicella-zoster virus (VZV). It causes a blister-like rash, itching, tiredness, and fever. The rash appears first on the stomach, back and face and can spread over the entire body causing between 250 and 500 itchy blisters.','2018-01-30 19:08:33','2018-01-30 19:08:33',0),(23,'Conjunctivitis','Conjunctivitis is an inflammation or swelling of the conjunctiva. The conjunctiva is the thin transparent layer of tissue that lines the inner surface of the eyelid and covers the white part of the eye. Often called \"pink eye,\" conjunctivitis is a common eye disease, especially in children.','2018-01-30 19:08:45','2018-01-30 19:08:45',0),(24,'Dengue','An acute infectious disease caused by a flavivirus (species Dengue virus of the genus Flavivirus), transmitted by aedes mosquitoes, and characterized by headache, severe joint pain, and a rash called also breakbone fever, dengue fever.','2018-01-30 19:09:00','2018-01-30 19:09:00',0),(25,'Diabetes Mellitus','Diabetes mellitus: More commonly referred to as \"diabetes\" -- a chronic disease associated with abnormally high levels of the sugar glucose in the blood. ... Inadequate production of insulin (which is made by the pancreas and lowers blood glucose), or. Inadequate sensitivity of cells to the action of insulin.','2018-01-30 19:09:13','2018-01-30 19:09:13',0),(26,'Diarrhea','Diarrhea, also spelled diarrhoea, is the condition of having at least three loose or liquid bowel movements each day. It often lasts for a few days and can result in dehydration due to fluid loss.','2018-01-30 19:09:24','2018-01-30 19:09:24',0),(27,'Fever','Fever, also known as pyrexia and febrile response, is defined as having a temperature above the normal range due to an increase in the body\'s temperature set-point. ... A fever can be caused by many medical conditions ranging from not serious to potentially serious.','2018-01-30 19:09:31','2018-01-30 19:09:31',0),(28,'Goiter','A goiter (GOI-tur) is an abnormal enlargement of your thyroid gland. Your thyroid is a butterfly-shaped gland located at the base of your neck just below your Adam\'s apple. Although goiters are usually painless, a large goiter can cause a cough and make it difficult for you to swallow or breathe.','2018-01-30 19:09:48','2018-01-30 19:09:48',0),(29,'Headache','These headaches are often described as pounding, throbbing pain. They can last from 4 hours to 3 days and usually happen one to four times per month. Along with the pain, people have other symptoms, such as sensitivity to light, noise, or smells; nausea or vomiting; loss of appetite; and upset stomach or belly pain.','2018-01-30 19:09:57','2018-01-30 19:09:57',0),(30,'Heart disease','Cardiovascular disease generally refers to conditions that involve narrowed or blocked blood vessels that can lead to a heart attack, chest pain (angina) or stroke. Other heart conditions, such as those that affect your heart\'s muscle, valves or rhythm, also are considered forms of heart disease.','2018-01-30 19:10:05','2018-01-30 19:10:05',0),(31,'Hypertension','Hypertension (HTN or HT), also known as high blood pressure (HBP), is a long-term medical condition in which the blood pressure in the arteries is persistently elevated. High blood pressure usually does not cause symptoms.','2018-01-30 19:10:24','2018-01-30 19:10:24',0),(32,'Influenza','Influenza, commonly known as \"the flu\", is an infectious disease caused by an influenza virus. Symptoms can be mild to severe. The most common symptoms include: a high fever, runny nose, sore throat, muscle pains, headache, coughing, and feeling tired.','2018-01-30 19:10:36','2018-01-30 19:10:36',0),(33,'Intestinal parasitism','Intestinal parasite: A parasite (an organism that lives in or on and takes its nourishment from another organism) in the intestinal tract. Intestinal parasites include both helminths and protozoa. Helminths are worms such as tapeworms, pinworms, and roundworms.','2018-01-30 19:10:53','2018-01-30 19:10:53',0),(34,'Mass (bukol)','MASS (mitral valve prolapse, aortic enlargement, skin and skeletal findings) syndrome is a genetic disorder of connective tissue caused by mutations in the FBN1 gene . Connective tissue is the material between the cells of the body that gives tissues form and strength.','2018-01-30 19:11:05','2018-01-30 19:11:05',0),(35,'Nutritional deficies','An inadequate supply of essential nutrients (as vitamins and minerals) in the diet resulting in malnutrition or disease.','2018-01-30 19:11:21','2018-01-30 19:11:21',0),(36,'Otitis Media','Otitis media: Inflammation of the middle ear characterized by the accumulation of infected fluid in the middle ear, bulging of the eardrum, pain in the ear and, if eardrum is perforated, drainage of purulent material (pus) into the ear canal.','2018-01-30 19:11:31','2018-01-30 19:11:31',0),(37,'Pneumonia','Pneumonia. Pneumonia is a bacterial, viral, or fungal infection of one or both sides of the lungs that causes the air sacs, or alveoli, of the lungs to fill up with fluid or pus. Symptoms can be mild or severe and may include a cough with phlegm (a slimy substance), fever, chills, and trouble breathing.','2018-01-30 19:11:40','2018-01-30 19:11:40',0),(38,'Skin Disease','Acneâ€”A disease that affects the skin\'s oil glands. ... Eczemaâ€”Also known as atopic dermatitis, this is a long-term skin disease. The most common symptoms are dry and itchy skin, rashes on the face, inside the elbows, behind the knees, and on the hands and feet.','2018-01-30 19:12:01','2018-01-30 19:12:01',0),(39,'Sore Eyes','Itchy, red, sore eyes. Allergies and eye infections can both cause your eyes to feel sore, red and itchy. Often, itchy or irritated eyes can become sore after excessive rubbing. The eye infection conjunctivitis is a particularly common cause of sore, red eyes.','2018-01-30 19:12:08','2018-01-30 19:12:08',0),(40,'Stomach Ache','A nonmedical term most often used to describe pain in the mid- or upper abdominal area. ... Various organs can be the source of pain in the upper abdomen, including the small intestine, colon, liver, gallbladder, and pancreas.','2018-01-30 19:12:15','2018-01-30 19:12:15',0),(41,'TB (Tuberculosis)',' (TB) is an infectious disease usually caused by the bacterium Mycobacterium tuberculosis (MTB). Tuberculosis generally affects the lungs, but can also affect other parts of the body. Most infections do not have symptoms, in which case it is known as latent tuberculosis','2018-01-30 19:12:26','2018-01-30 19:12:26',0),(42,'Toothache','Pain in the tooth or gum. The most common cause of a toothache is a cavity or an injury to a tooth that exposes the pulp, which is heavily supplied by nerves.','2018-01-30 19:12:35','2018-01-30 19:12:35',0),(43,'UTI (urinary tract infection)','An infection of the kidney, ureter, bladder, or urethra. Abbreviated UTI. Not everyone with a UTI has symptoms, but common symptoms include a frequent urge to urinate and pain or burning when urinating.','2018-01-30 19:12:50','2018-01-30 19:12:50',0),(44,'Wound','Necrotic tissue, slough, and eschar. The wound bed may be covered with necrotic tissue (non-viable tissue due to reduced blood supply), slough (dead tissue, usually cream or yellow in colour), or eschar (dry, black, hard necrotic tissue). Such tissue impedes healing.','2018-01-30 19:12:57','2018-01-30 19:12:57',0),(45,'HIV','HIV (human immunodeficiency virus) is a virus that attacks the immune system, the body\'s natural defense system. Without a strong immune system, the body has trouble fighting off disease. Both the virus and the infection it causes are called HIV. White blood cells are an important part of the immune system.','2018-01-31 02:23:02','2018-01-31 02:23:02',0),(46,'AIDS','AIDS is not a virus but a set of symptoms (or syndrome) caused by the HIV virus. A person is said to have AIDS when their immune system is too weak to fight off infection, and they develop certain defining symptoms and illnesses. This is the last stage of HIV, when the infection is very advanced, and if left untreated will lead to death.','2018-01-31 03:19:42','2018-01-31 03:19:42',0);

